import React from 'react';
import ReactDom from 'react-dom'

// stateless functional component (must captialize the first character)
function GreetingHTML() {
  // return JSX/Html
  return (
    <React.Fragment>
      <h4>This is first component</h4>
      <h4>To have multiple element in a component use "React.Fragment"</h4>
    </React.Fragment>
  );
}

const GreetingJSX = () => {
  return React.createElement('h4', {}, 'This is second component')
}
ReactDom.render(<GreetingHTML/>, document.getElementById('root'));
